import Header from "./Header";
import Card from "./Card";

function Main({cards}) {
  

  return (
    <>
      <Header />
      <main className="content">
      <section className="elements">
      <article className="element">
            <button className="element__add-button" />
        </article>
        {cards.map((card) => {
          return (
            <Card/>
          );
        })}
      </section>
    </main>
    </>
  );
}

export default Main;
